.text
.globl main

main:
    # Configuracin: 128x128 pixeles
    li s0, 0x10010000       # Base Address del Bitmap Display
    la s1, pixel_data       # Direccin de nuestros datos de imagen
    li t0, 16384 # Total de pxeles a dibujar

render_loop:
    beq t0, zero, end_prog  # Si contador es 0, terminar
    lw t1, 0(s1)            # Cargar color desde el array data
    sw t1, 0(s0)            # Pintar pxel en pantalla
    
    addi s0, s0, 4          # Siguiente pxel en pantalla
    addi s1, s1, 4          # Siguiente color en data
    addi t0, t0, -1         # Decrementar contador
    j render_loop

end_prog:
    li a7, 10
    ecall
